	["so_purple"] = { name = "Ультрафіолет", desc = "Частини зброї пофарбовані аерозольною фарбою в пурпурово-чорній кольоровій гамі.\n\nЕлегантний дизайн поєднано зі злочинними намірами" },
	["so_night"] = { name = "Ніч", desc = "Частини зброї пофарбовані аерозольною фарбою в кольоровій гамі нічного пейзажу.\n\nЦе шепіт вітру… це укус на вашій шиї" },
	["so_caramel"] = { name = "Карамель", desc = "Частини зброї пофарбовані аерозольною фарбою в карамельно-чорній кольоровій гамі." },
