	["so_stormfront"] = { name = "Шторм", desc = "Частини зброї пофарбовані аерозольною фарбою в суцільній штормовій кольоровій гамі.\n\nЧекатиме вас на монорельсі" },
	["so_tornado"] = { name = "Смерч", desc = "Частини зброї пофарбовані аерозольною фарбою в кольоровій гамі смерчу.\n\nНе дайте себе одурити його простотою" },
	["so_whiteout"] = { name = "Сніжна мла", desc = "Зброя пофарбована повністю в білий колір.\n\nВиглядає чисто, але зовнішність оманлива" },
	["so_jungle"] = { name = "Джунглі", desc = "Частини зброї пофарбовані аерозольною фарбою в кольоровій гамі джунглів." },
	["so_space_marine"] = { name = "Колонія", desc = "Частини зброї пофарбовані аерозольною фарбою в хакі та сірий колір." },
	["so_pmc"] = { name = "Найманець", desc = "Частини зброї пофарбовані аерозольною фарбою в брунатний, темно-синій та темно-зелений кольори.\n\nРона Сабрі досі не пробачила Себастьяну те, що він не обрав її для знищення Тернера" },
	["so_tangerine"] = { name = "Підрив", desc = "Частини зброї пофарбовані аерозольною фарбою в червоно-помаранчевій кольоровій гамі.\n\n«Рона настільки ж управна, як вона про себе думає… вона просто недостатньо досвідчена, щоби зрозуміти, що не потрібно це говорити кожному» — командир Фелікс Райлі" },
