	["an_silver"] = { name = "Срібло", desc = "Нанесено зображення із хромовою основою, що вкрита прозорим шаром срібла задля ефекту анодованості.\n\n«В простоті існує краса» — Франц Кригельд, стратег угрупування «Фенікс»" },
	["an_red"] = { name = "Хот-род", desc = "Нанесено зображення із хромовою основою, що вкрита прозорим шаром червоного задля ефекту анодованості.\n\nАвтоматичне. Систематичне. Гідроматичне." },
