	["am_urban"] = { name = "Пікс. камуфляж «Металічний»", desc = "Аквадруком на металеву основу нанесено текстуру міського піксельного камуфляжу." },
	["am_tiger"] = { name = "Золотий тигр", desc = "Нанесено золотий шар, на якому вручну вигравіювані смужки у вигляді шкіри тигра." },
	["am_dragon_glock"] = { name = "Тату дракона", desc = "На металеву основу наклеєно малюнок у вигляді дракона.\n\nУ казках лицар завжди вбиває дракона… однак це реальний світ — Валерія Дженнер, революціонерка" },
	["am_caustics"] = { name = "Каустика", desc = "Аквадруком нанесено червоний і білий колір на вугільно-чорну металеву основу." },
	["am_lightning_awp"] = { name = "Удар блискавки", desc = "На металеву основу нанесено малюнок у вигляді блискавок з використанням ефекту анодованості.\n\nІноді вам не потрібно бити в одне місце двічі" },
	["am_ossify"] = { name = "Закостенілий", desc = "Аквадруком нанесено прозорий світло-зелений абстрактний малюнок на металеву основу." },
	["aa_flames"] = { name = "Полум’я", desc = "Аерографічний малюнок нанесено прозорою фарбою на хромову основу." },
	["aa_splash_p250"] = { name = "Бризк", desc = "Аерографічний малюнок нанесено прозорою фарбою за допомогою трафарету на хромову основу." },
	["aa_fade"] = { name = "Градієнт", desc = "Аерографічний малюнок нанесено напівпрозорими фарбами, що переходять одна в одну, на хромову основу.\n\n«Це не просто зброя, це жанрова картина» — Імоґен, продавець зброї" },
	["aa_fade_metallic"] = { name = "Бурштиновий градієнт", desc = "aa_fade_metallic" },
	["aa_fade_grassland"] = { name = "Кислотний градієнт", desc = "aa_fade_grassland" },
	["aq_copper"] = { name = "Мідь", desc = "Покрито міддю." },
	["aq_blued"] = { name = "Блакитна сталь", desc = "Розфарбовано синім кольором із холодним відтінком.\n\nЦе справжній виноград зброярства — Бут, продавець зброї" },
	["aq_forced"] = { name = "Наліт іржі", desc = "Нанесено патину, зроблену з лимона та гірчиці.\n\nЯкщо гадаєте, що це безлад, то погляньте на це в ультрафіолеті" },
	["aq_oiled"] = { name = "Поверхневий гарт", desc = "Загартовано за допомогою дерев’яного вугілля на високих температурах.\n\nТрохи кольору нікому не зашкодить" },
	["sp_spitfire_famas"] = { name = "Спітфайр", desc = "sp_spitfire_famas" },
	["am_zebra"] = { name = "Бійня", desc = "Нанесено зображення у вигляді смужок зебри з використанням алюмінієвого та хромового кольору з різними рефлексами, а потім вкрито томатно-червоним шаром.\n\nВалерія не платить Хав’єру, аби він ставив питання… вона йому платить, щоби він діставав відповіді" },
	["am_zebra_dark"] = { name = "Темна вода", desc = "Нанесено зображення у вигляді водяних смуг із використанням вугільно-металевого кольору різних відтінків на хромову основу.\n\nВода дає життя, але вона ж може його забрати" },
	["aa_vertigo"] = { name = "Гіпноз", desc = "На пурпурову основу аерозольним балончиком нанесено чорний візерунок за допомогою трафарету.\n\nВам не просто спати захотілося, це ви помираєте від втрати крові" },
	["cu_spring_nova"] = { name = "Квітуча гілка", desc = "Вручну нанесено аерографічне зображення квіток вишні, а потім вкрито глянцевим лаком." },
	["sp_hazard"] = { name = "Загроза", desc = "sp_hazard" },
	["aq_rust"] = { name = "Іржа", desc = "Хоча зовнішня поверхня вкрилася іржею, однак ця зброя все ще цілковито боєздатна." },
	["am_slither_p90"] = { name = "Холоднокровний", desc = "На хромову основу нанесено напівпрозору червону фарбу задля ефекту адонованості. Потім лазером було вигравіювано візерунок у вигляді шкіри змії." },
	["am_carbon_fiber"] = { name = "Вуглепластик", desc = "Аквадруком нанесено вуглецевий малюнок на графітну основу.\n\n«Те, що я найкраща в команді, не означає, що я могла б обійтися без неї» — Рона Сабрі, перспективний боєць" },
	["am_scorpion_p2000"] = { name = "Скорпіон", desc = "Нанесено зображення з ефектом анодування і хвилястими переходами, а на руків’ї наклеєне зображення червоного скорпіона." },
	["hy_feathers_aug"] = { name = "Крила", desc = "Декоровано наклейками із зображенням пір’їн орла.\n\nОрел виглядає дуже величним, коли викльовує ваші очі" },
	["sp_palm"] = { name = "Пальма", desc = "Аерозольним балончиком нанесено малюнок за допомогою трафарету зі шматків картону, дрібної сітки та пальмового листя." },
	["sp_palm_shadow"] = { name = "Тропічний шторм", desc = "sp_palm_shadow" },
