	["cu_pinstripe_ak47"] = { name = "Смарагдові витки", desc = "Нанесено зображення у вигляді поверхні мореного дуба, покритої білими та зеленими завитками.\n\n«Питаючи Імоґен, ви питаєте мене. А тепер розслабтеся, випийте скляночку скотчу, і поговорімо про бізнес» — Батько та «Фенікс», частина 2" },
