	["am_metals"] = { name = "Лицар", desc = "Зброя має латунні інкрустації в стилі обладунків епохи Відродження.\n\n«Як це ви не можете знайти Кочінеро та Ідзакі?» — командир Фелікс Райлі" },
	["am_chainmail"] = { name = "Кольчуга", desc = "Аквадруком нанесено напівпрозору текстуру кольчуги поверх срібного тла.\n\nСеред усіх членів «Фенікса», ніхто так не наближений до Валерії так, як її охоронець Наомі" },
	["aq_handcannon"] = { name = "Ручна гармата", desc = "Зброя має латунні вставки з використанням кислотної патини, що нагадує старовинні латунні гармати.\n\nБудьте готові зіштовхнутись із безліччю шипів у випробуванні" },
	["am_metal_inlay"] = { name = "Темні віки", desc = "Нанесено зображення металізованими фарбами так, аби зброя здавалася інкрустованою в середньовічному стилі.\n\n«Я не можу вбити її коханця… можливо, це зможе дати вам із Валерією трохи часу» — Батьківська любов, частина 2" },
	["hy_vines"] = { name = "Шипшина", desc = "Аквадруком нанесено текстуру лози та квітів, що звиваються.\n\nСправжній цілунок кохання не може врятувати від дотику щетини" },
	["so_indigo"] = { name = "Королівський синій", desc = "Пофарбовано в суцільні барви сірого, індиго й малинового.\n\n«Вам треба посміхатися, Феліксе, так би мали більше успіху з жінками, бо не виглядали б увесь час як суворий виродок» — Імоґен, продавець зброї" },
	["so_indigo_and_grey"] = { name = "Індіґо", desc = "Пофарбовано в суцільні барви сірого, індиго й синього.\n\n«Алекс Кінкейд, впевнений, ви маєте багато запитань… Будь ласка, дозвольте на них відповісти» — «Фенікс» і оповідач, частина 1" },
	["cu_well_traveled_ak47"] = { name = "Турист", desc = "Приклад та руків’я цієї зброї обшито шкірою. Ця зброя побувала в багатьох містах.\n\n«Будь-хто хто зверне увагу, помітить точки і побачить, що вона зробила. Ми не маємо вдосталь часу, щоби знайти вихід…» — Батьківська любов, частина 1" },
	["cu_green_leather"] = { name = "Люкс", desc = "Приклад цієї зброї було обшито зеленою шкірою.\n\nМімоза продається окремо" },
	["cu_brown_leather_p90"] = { name = "Шкіра", desc = "Приклад цієї зброї було обшито коричневою шкірою.\n\nНе переживайте, на митниці вас пропустять!" },
	["cu_luggage_mac10"] = { name = "Пасажир", desc = "Аквадруком нанесено картату текстуру, а також частково обшито штучною шкірою крокодила.\n\n«Вони купилися на приманку, наступаємо…» - Еліот Кінґсмен, найманець" },
	["cu_medieval_dragon_awp"] = { name = "Знання дракона", desc = "На зброю нанесено зображення виплетеного дракона.\n\nНавіть двісті ключів не відкриють його таємницю" },
	["cu_luggage_p2000"] = { name = "Плацкарта", desc = "Аквадруком нанесено картату текстуру, а також коричневою шкірою обшито частини руків’я.\n\nЦе не витончено, але він доставить вас туди, куди потрібно" },
	["aq_pilot_deagle"] = { name = "Пілот", desc = "Має латунні вставки й зображення авіаційних крил.\n\nВорог буде збитим" },
	["cu_leather_xm1014"] = { name = "Червона шкіра", desc = "Приклад цієї зброї обшито червоною шкірою.\n\n«Пакуйте валізи. Підемо за головою сучого сина…» — Демон та Валькірія, частина 2" },
	["cu_luggage_sg553"] = { name = "Мандрівник", desc = "Нанесено стрічковане зображення, схоже на вигляд класичних сумок для багажу. Також певні частини зброї обшито коричневою шкірою.\n\nВсі мають свою історію, і Хав’єр її вислухає перед тим, як вбити вас" },
	["cu_luggage_usp-s"] = { name = "Бізнес-клас", desc = "Нанесено зображення з використанням барв та візерунків, характерних для класичних сумок для багажу. Також певні частини зброї обшито коричневою шкірою.\n\nДеяким недостатньо тільки простягнути ноги… вони хочуть миру та покою" },
	["hy_plaid1"] = { name = "Оливковий плед", desc = "Аквадруком нанесено бежеву текстуру з оливковими картатими візерунками.\n\n«Мені подобається. Це підкреслить мої очі на камер…» — Рона Сабрі, молода зірка" },
