	["cu_tribute_ak47"] = { name = "Пустельний повстанець", desc = "Обшарпано, нанесено зображення за допомогою трафарету, а потім графіті.\n\n«Одного дня вони попросять мене воювати, і коли це трапиться, то все зрозуміють» — Наомі, охоронець Валерії Дженнер" },
	["aq_glock_coiled"] = { name = "Жорно", desc = "Сталевий затвор розфарбовано масляними фарбами з використанням трафарету.\n\nЄдиний спосіб зробити діаманти — застосувати тиск" },
	["am_g3sg1_murky"] = { name = "Морок", desc = "Анодовано, а потім нанесено аквадруком леопардовий візерунок.\n\nЗавжди є темніше місце, ніж це" },
	["aq_m4a1s_basilisk"] = { name = "Василіск", desc = "Витравлено зображення василіска.\n\nВитріщатися негарно, але війна — не місце для люб’язності" },
	["cu_m4a4_griffin"] = { name = "Грифон", desc = "Вручну нанесено зображення грифона.\n\nФелікс вибирав собі команду серед оперативників зі всього світу… І поки люди ставлять під питання їхні моральні якості, вони виконують все без питань!" },
	["sp_mag7_firebitten"] = { name = "Запальник", desc = "Аерозольним балончиком у кілька шарів нанесено зображення, а потім обшарпано, щоби створити ефект палаючих країв.\n\nЦе завжди починається з маленької іскри" },
	["cu_mp9_chevron"] = { name = "Жало", desc = "Водостійкою фарбою нанесені смуги у вигляді шевронів.\n\nЧим більше пострілів, тим більший шанс влучання" },
	["aq_p250_cartel"] = { name = "Картель", desc = "Вигравіювано зображення черепів, квітів і змій.\n\nОдин маленький потиск перетворює кожен ранок на День мертвих" },
	["cu_p2000_fire_elemental"] = { name = "Дух вогню", desc = "Нанесено зображення вогняної істоти в графічному стилі.\n\nДеколи гра з вогнем може принести користь" },
	["aq_sawedoff_blackgold"] = { name = "Розбійник", desc = "Нанесено зображення заростей чортополоху чорною й золотою лаковою фарбою.\n\nНе варто відводити мізинець під час стрільби, але це виглядає красиво" },
	["cu_scar20_intervention"] = { name = "Сердечник", desc = "Запечатано у вінілову оболонку із сучасним помаранчевим і синім дизайном.\n\nбіп, біп, бі-і-і-і-і-і-іп…" },
	["sp_ump45_d-visions"] = { name = "Омана", desc = "Нанесено зображення на морську тематику трафаретним друком.\n\nПоклик Каркоси" },
	["cu_xm1014_caritas"] = { name = "Лагідність", desc = "Вручну нанесено зображення жінки з довгим волоссям.\n\n«Я тут не заради того, що мені потрібно; я тут заради того, що бажаю» — Імоґен та Оні, частина 2" },
	["am_awp_glory"] = { name = "Лінкор", desc = "Нанесено основу з синього металіку, а потім вручну намальовано зображення візерунків і акцентів металевою золотою фарбою.\n\nПриверніть увагу деяких голів, перш ніж прострелити їх" },
	["cu_elites_urbanstorm"] = { name = "Міський перламутр", desc = "Нанесено зображення у вигляді сучасного камуфляжу із синіми акцентами.\n\nЗа світлом завжди слідує грім" },
	["aq_deagle_naga"] = { name = "Нага", desc = "Вигравіювано міфологічний мотив.\n\nЗвір в індійській міфології такий же небезпечний, як і на полі бою" },
	["cu_galil_abrasion"] = { name = "Тріскачка", desc = "Вручну нанесено зображення, а потім обшарпано. Під час стрільби здається, що череп на протипиловій шторці смикає щелепою.\n\nКажуть, що коли ви засмієтеся, то весь світ засміється з вами… Та коли сміється «Тріскачка» — світ кричить від жаху" },
	["cu_glock_deathtoll"] = { name = "Катакомби", desc = "На срібну металеву основу аквадруком нанесено зображення черепів.\n\nЗалякування — найщиріша форма поваги" },
	["cu_m4a4_ancestral"] = { name = "龍王 (Цар драконів)", desc = "Нанесено зображення дракона в червоних і синіх кольорах.\n\n«Ця зброя підійде самому Королю Мавп» — Бут, продавець зброї" },
	["cu_m249_sektor"] = { name = "Блокування системи", desc = "Нанесено зображення в науково-фантастичному стилі.\n\nПрикриття ще ніколи не було таким чудовим" },
	["am_mac10_malachite"] = { name = "Малахіт", desc = "На основу металевого кольору гумовим гребенем нанесено хвилястий візерунок.\n\nЯскраві кольори зброї приховують її темне призначення" },
	["cu_mp9_deadly_poison"] = { name = "Смертельна отрута", desc = "Нанесено зображення динамічних і різких фігур, а також стилізований малюнок павука.\n\nПерший укус вас не вб’є, але за ним слідуватимуть ще 29" },
	["cu_p250_mandala"] = { name = "День мертвих", desc = "Нанесено зображення кружних візерунків.\n\nВитримано в традиції та крові" },
	["cu_sawedoff_deva"] = { name = "Спокій", desc = "Вручну нанесено зображення жінки з крилами.\n\n«Спокій — це розкіш, що доступна небагатьом» — Валерія Дженнер, революціонерка" },
	["aq_scar20_leak"] = { name = "Грот", desc = "За допомогою губки та пензля нанесено зображення з металевим ефектом.\n\nЗасновник корпорації «Сезон» замовив цю зброю відомому службовцю Котаро Ідзакі на знак подяки за порятунок" },
	["aq_xm1014_sigla"] = { name = "Ртуть", desc = "На срібну металеву основу аквадруком нанесено візерунок у вигляді мапи місцевості.\n\nІноді вам потрібен ефект несподіванки, щоби вирішити ваші проблеми — Котаро Ідзакі, спеціаліст із проламування" },
	["an_tiger_orange"] = { name = "Тигряче ікло", desc = "Анодовано в помаранчевий колір, а також вручну вигравіювано тигрові смуги.\n\nРідкісний, як тигр… Смертельний, як тигр…" },
