	["hy_p250_crackshot"] = { name = "Постріл у літуна", desc = "Аквадруком нанесено яскраву текстуру.\n\n«Інколи, щоб отримати бажане, достатньо лише ніжного дотику» — Франц Кріґельд, стратег угрупування «Фенікс»" },
