	["cu_ssg08_technicality"] = { name = "Великий ствол", desc = "Аквадруком нанесено жовту й помаранчеву текстуру, а потім трішки затерто.\n\n«Перемога з приміткою — теж перемога» — Рона Сабрі, молода зірка" },
