	["handwrap_fabric_orange_camo"] = { name = "Дикі землі", desc = "Цей захист типу «зроби сам» зібрано з підручних матеріалів.\n\nФелікс заплющує очі на незаконні чемпіонати з боксу серед оперативної групи коаліції" },
	["slick_black"] = { name = "Місячний візерунок", desc = "Синя замша переплетена з чорною шкірою для надання цим рукавицям старовинного вигляду.\n\nНа ваших руках кров… якщо говорити фігурально" },
	["slick_military"] = { name = "Конвой", desc = "Зроблені з коричневої м’якої шкіри та пофарбованої замші.\n\nІноді потрібно діяти розсудливо" },
	["slick_red"] = { name = "Багряний візерунок", desc = "Чорна замша переплетена з червоною шкірою для надання цим рукавицям старовинного вигляду.\n\nЗалишайте слід, а не відбитки" },
	["slick_snakeskin_yellow"] = { name = "Гримучник", desc = "Зроблені зі шматків засмаглої шкіри, чорної шкіри та зміїної шкіри.\n\n«Звичайні види для невдах…» — Імоґен, продавець зброї" },
	["sporty_green"] = { name = "Живий лабіринт", desc = "Зелені з білим рукавиці, виготовлені компанією «Ікарус Атлетикс».\n\nТільки боягузи бояться підлетіти близько до сонця" },
	["sporty_purple"] = { name = "Скриня Пандори", desc = "Чорні з фіолетовим рукавиці, на долоні ледь помітний візерунок.\n\nКожен підривник зі спітнілими долонями повинен мати пару таких" },
	["sporty_light_blue"] = { name = "Надпровідник", desc = "Сині з чорним рукавиці ідеально підходять для тих, что хоче бути феноменом.\n\nЇм не потрібні проблеми" },
	["sporty_military"] = { name = "Сухий", desc = "Кілька відтінків коричневого й тонкий камуфляжний візерунок надають цим рукавицям вишуканого вигляду.\n\n«Якщо ми хочемо стати героями, то нам потрібно виглядати як герої…» — Рона Сабрі, молода зірка" },
	["specialist_ddpat_green_camo"] = { name = "Пікс. камуфляж «Ліс»", desc = "На вручну зшиту шкіру нанесено камуфляж.\n\nДехто не любить бруднити свої руки" },
	["specialist_kimono_diamonds_red"] = { name = "Багряне кімоно", desc = "Пара чорних рукавичок із нанесеним візерунком червоного алмазу.\n\nПочинайте помічати червоний" },
	["specialist_emerald_web"] = { name = "Смарагдове павутиння", desc = "На тильній стороні рукавичок нанесено візерунок павутиння.\n\nДисципліна — запорука успіху" },
	["specialist_white_orange_grey"] = { name = "Фундамент", desc = "До білих із червоним рукавиць додано помаранчеві відтінки.\n\nКажуть, Тортуга надихався серією зброї «Азімов»" },
	["motorcycle_basic_black"] = { name = "Затемнення", desc = "Оригінальний класичний чорний дизайн, який зробив Тортугу загальною назвою.\n\nЦе не криза середнього віку" },
	["motorcycle_mono_boom"] = { name = "БАХ!", desc = "Ці рукавиці вкриті звуконаслідувальними написами з коміксів.\n\nБАМ! БУМ! ПТИЩ!" },
	["motorcycle_mint_triangle"] = { name = "М’ята", desc = "Ці рукавиці з білої шкіри та червоної стрічки не тільки зручні, а й стильні.\n\n«За таку ціну Гакслі міг би додати хоча б баночку льодяників…» — командир Фелікс Райлі" },
	["motorcycle_triangle_blue"] = { name = "Свіжа м’ята", desc = "На м’яку синю шкіру нанесено арктичні кольорові геометричні візерунки.\n\nБій ще ніколи не був таким освіжаючим." },
