	["aq_Five_Seven_Scumbria"] = { name = "Скумбрія", desc = "Нанесено стримані лінії.\n\nНе можна лишати його помирати, Феліксе, ви маєте його врятувати — Донька і паладин, частина 1" },
	["gs_G3SG1_Ventilator"] = { name = "Вентилятор", desc = "Пофарбовано в елегантне чорне забарвлення з хромуванням і доповнено особливим гумовим руків’ям.\n\n«Не бійтеся, Наомі, я змушу Фелікса заплатити» — Міха Бітон, снайпер «Фенікса»" },
	["cu_Glock18_Weasel"] = { name = "Ласка", desc = "Аквадруком нанесено зображення пустотливого самця ласки Боббі. Не зліть його.\n\nВін милий, та це не значить, що він не вкусить" },
	["cu_MAG7_Tribal"] = { name = "Петрогліф", desc = "Забарвлення імітує наскельний живопис.\n\n«Конфлікти існують із часу, коли перша печерна людина взяла до рук камінь» — Бут, продавець зброї" },
	["cu_MP9_Narcis"] = { name = "Повітряний шлюз", desc = "Забарвлено в білий колір із яскраво-червоним магазином.\n\nІдеально для стрільби по тостерах" },
	["hy_Negev_Dazzle"] = { name = "Осліплення", desc = "Вкрито наліпками у вигляді синіх і білих смужок зебри.\n\nРадість для любителів воєнної історії" },
	["cu_P90_Grimm"] = { name = "Похмурість", desc = "Аквадруком нанесено зображення вбивчих привидів, а потім сухим пензлем додано зелені акценти.\n\n«Імоґене… Ви продаєте мені зброю чи картинку?» — Рона Сабрі, молода зірка" },
	["gs_SCAR20_Powercore"] = { name = "Енергогенератор", desc = "Пофарбовано в зелений колір із жовтими акцентами. Додано штрих-код для зручності покупця.\n\nПравило номер один — завоювати серце клієнта" },
	["cu_SG556_Triarch"] = { name = "Тріарх", desc = "Ця гвинтівка виготовлена на замовлення королівської сім’ї та отримала пустельний камуфляж.\n\nНагадайте їм про свою любов" },
	["gs_TEC9_Supercharged"] = { name = "Паливний інжектор", desc = "Основу розфарбовано яскраво-жовтими фарбами, а на ріжок аквадруком нанесено текстуру механізму. Шкіряна обшивка руків’я ручної роботи завершує класичний сієтлівський стиль\n\nЕкіпаж механіків до комплекту не входить" },
	["cu_UMP45_Metritera"] = { name = "Інструктаж", desc = "Аквадруком нанесено зображення топографічної мапи.\n\nЗустріч буде недовгою…" },
	["hy_XM1014_Fractal_Blue"] = { name = "Повітряний потік", desc = "Забарвлено в димчастий сірий та яскраво-блакитний кольори.\n\n«Терпіння, Еліоте, вони ще зіграють свою роль…» — Найманець та Змій, частина 2" },
	["am_czv2_mf"] = { name = "Полімер", desc = "Наклейка на затворі нагадує формулу полімерів.\n\n«Ви вже не працюєте на “Фенікс”. Ми знаємо, як самим впоратися…» — Донька і паладин, частина 2" },
	["aq_glock_dark-fall"] = { name = "Металева конструкція", desc = "Лазером вигравіювано вербу та шипи.\n\nЯкщо за садом не доглядати, то він заросте бур’янами" },
	["cu_ssg08_dragonfire_scope"] = { name = "Полум’я дракона", desc = "Аквадруком нанесено водостійке зображення чудовиська-дракона, який дихає полум’ям.\n\nСидіть на своїх скарбах і очікуйте, хто за ними прийде" },
	["gs_dual_berettas_golden_venice"] = { name = "Королівська пара", desc = "Руків’я пофарбовано зеленою перламутровою фарбою, бокові пластини мають зображення грифона, а затвор — лазерне гравіювання. Ця зброя змінює уявлення про елегантність.\n\nМіняймо обличчя та випускаймо голубів" },
	["gs_famas_mecha"] = { name = "Меха-індустрія", desc = "Контрастний чорно-білий дизайн робить цю зброю схожою на науково-фантастичну.\n\nСиня фарба для волосся й робот-напарник у комплект не входять" },
	["gs_final_pooldeadv2"] = { name = "Периста хмара", desc = "Пофарбовано в металево-синій колір та додано зображення черепа.\n\nДосить літати у хмарах" },
	["gs_g3sg1_viper_yellow"] = { name = "Жало", desc = "Додано жовті та сірі акценти.\n\nМить болю. І більше нічого" },
	["cu_galil_ar-camo"] = { name = "Чорний пісок", desc = "Пофарбовано в чорний камуфляж.\n\nМіха Бетон збирається виступити проти сил коаліції" },
	["aa_hide-mp9"] = { name = "Осад", desc = "Пофарбовано в синій та брунатний колір.\n\n«Нам слід підготуватися до відплати» — командир Фелікс Райлі" },
	["cu_m4a1_flashback"] = { name = "Флешбек", desc = "Вручну нанесено зображення, яке показує двоїсту природу людини.\n\nЗа джокера в кожному з нас" },
	["gs_m4a4_sector"] = { name = "Кайфолом", desc = "Цю зброю від «Сектор Індастрі» охайно пофарбовано в жовтий та зелений кольори.\n\nЗіпсує будь-яку вечірку" },
	["am_mag7_malform"] = { name = "Сонар", desc = "Через трафарет нанесено бірюзовий візерунок.\n\n«Ви праві, програш — це новий досвід для мене» — Демон і Валькірія, частина 2" },
	["am_nova_sand"] = { name = "Жилатьє", desc = "Нанесено візерунок у формі шкіри ящірки.\n\n«Ви поводитеся так, ніби найманці раніше вас не ловили» — Демон і Валькірія, частина 1" },
	["gs_p2000-sport"] = { name = "Дерен", desc = "Руків’я та затвор пофарбовані металево-зеленими барвами.\n\nЗ іншого боку трава завжди червоніша" },
	["gs_p90_shallow_grave"] = { name = "Неглибока могила", desc = "Руків’я пофарбовано так, щоби нагадувати рунні камені, а на прикладі аквадруком нанесено текстуру скелета.\n\nЗа такої кількості трупів копати ніколи" },
	["cu_usp_cyrex"] = { name = "Сайрекс", desc = "Червоні акценти надають зброї футуристичний вигляд.\n\n«Імоґен був попереднім Феніксом, а я — наступний» — Гакслі, «Змагання»" },
	["cu_wp_sawedoff"] = { name = "Принцеса пустоші", desc = "Хтось позначає кількість убивств на стволі.\n\nЧудовий дарунок для соціопата, у якого все є…" },
	["gs_ak47_bloodsport"] = { name = "Кривавий спорт", desc = "Аквадруком нанесено червоно-чорне зображення, вкрите білими наклейками.\n\nПотрібен другий водій" },
