	["cu_mac10_nacre"] = { name = "Диско-технології", desc = "Нанесено зображення перламутровою фарбою, щоби було схоже на вінілову наліпку. Залежно від освітлення зовнішній вигляд змінюється.\n\nДивіться, куди направляєте цю штуку" },
