	["cu_sg553_darkwing"] = { name = "Темнокрил", desc = "Нанесено червоно-чорний малюнок із пір’ям та іншими чорними деталями.\n\nГострозорий і смертоносний — небезпечнішого наземного птаха годі й знайти" },
