	["cu_mac10_isoonna"] = { name = "Спокуса", desc = "На МАК-10 нанесено нестандартний малюнок із жінкою в бірюзовому. Вважають, що це ісо-онна, яка стоїть навпроти риби-кої та розбиває хвилі.\n\nКраса починає кровопролиття" },
