	["cu_ak_jaguar"] = { name = "Ягуар", desc = "Дерево на прикладі та цівці прикрашене красивими різьбленнями, які часто відвертають увагу від нанесеного збоку зображення ягуара.\n\nХто сказав, що козаки тільки шаблями махати вміють?" },
	["cu_jaguar_p90"] = { name = "Біжи й ховайся", desc = "Нанесено нестандартний малюнок із текстурою ягуара й оброблено плямистою шкірою.\n\nБудь-хто може собі грішми відчинити двері до світу моди, однак мало хто має істинний стиль і смак" },
