	["am_ancient_warm"] = { name = "Древнє знання", desc = "Нанесено зображення із текстурою древніх плит блідо-зеленого, бежевого та червоного кольорів.\n\n«Надія залишається навіть із тими, хто пішов хибним шляхом»" },
	["aa_ruins_green"] = { name = "Зарослі руїни", desc = "На тлі цих розкішних кущів видніються обриси стародавніх богів.\n\n«Усім бути пильними — за нами стежать…»" },
