	["am_gold_brick"] = { name = "Золота цеглина", desc = "Це золоте покриття переливається на світлі, підкреслюючи кожну прекрасну недосконалість на зброї.\n\nУсе це блищить…" },
	["sp_ancient_bright"] = { name = "Древнє бачення", desc = "На корпус було нанесено червоно-зелену текстуру з хитромудрими смужками та древніми істотами.\n\nЦей привілей належить вам" },
