	["aa_mp9_fuji_pink"] = { name = "Гора Фудзі", desc = "Нанесено акриловий малюнок гори Фудзі на світанку. Використовується як візерунок, тому кожна зброя може виглядати по-різному.\n\nСходить червоне сонце" },
