	["cu_glock_snackattack"] = { name = "Атака смаколиків", desc = "Нанесено зображення, що нагадує залиті пластиком об’їдки.\n\nСмаколики завдають удар у відповідь" },
	["cu_ssg_overtake"] = { name = "Турборежим", desc = "Збоку цієї снайперської гвинтівки неоновими кольорами намальовані перегони спортивних автомобілів.\n\nДрифт — не привілей" },
