	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "На частини цього сувеніру з Cache аерозольною фарбою нанесено зображення в оливковій кольоровій гамі.\n\nНіколи не приймайте перемогу за належне" },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "На цей сувенір зі Siege нанесено хромову основу, а потім малюнок металевого відтінку з ефектом анодування.\n\n«Ви не знаєте Фелікса Райлі так, як знаю його я… Цього мужика не зламати!» — Зрадник та Правдолюб, частина 1" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "На цей сувенір із Seaside аквадруком нанесено напівпрозорий синій абстрактний малюнок на металеву основу.\n\n«Хвилі розбиваються, але не наша рішучість» — Котаро Ідзакі, спеціаліст із проламування" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "На цей сувенір з Agency нанесено хромову основу, а потім зображення полігональної сітки різними відтінками металевих кольорів.\n\nУрок завершено, ручки відклали" },
	["aq_steel"] = { name = "aq_steel", desc = "Усе ще чудово працює, незважаючи на іржу зовні.\n\nДекотрі особи не приховують, якими брудними є їхні діяння" },
	["hy_hex"] = { name = "hy_hex", desc = "Аквадруком нанесено візерунок у вигляді шестикутників." },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "Аквадруком нанесено дуже збільшену камуфляжну текстуру." },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "Нанесено металеву фольгу у вигляді піксельного камуфляжу." },
	["twigs"] = { name = "twigs", desc = "Аерозольним балончиком нанесено малюнок за допомогою трафарету з гілок." },
	["varicamo"] = { name = "varicamo", desc = "Аквадруком нанесено візерунок у вигляді змішаного камуфляжу.\n\nВідновлення приходить тільки після руйнування" },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "Викуваний із плашки, виготовленої з двох різних типів вуглецевої сталі.\n\nНарешті з’явилася зброя, яка відповідає вашій рішучості" },
	["am_crystallized"] = { name = "am_crystallized", desc = "Металевою фарбою нанесено малюнок за допомогою трафарету у вигляді кристалів.\n\nВсі хочуть бути впливовими" },
	["snakeskin"] = { name = "snakeskin", desc = "Аквадруком нанесено візерунок у вигляді шкіри змії.\n\n«Я знаю, ви мені не вірите… Та коли попадетеся, Валерія отримає вашу голову» — Щит і Змій, частина 1" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "Пофарбовано синім кобальтом, а за допомогою трафарету на магазин нанесено логотип спецпризначенців.\n\n«Можу слідувати протоколу і витягти сімох, чи я можу зробити це у свій спосіб і врятувати всіх десятьох… вибір за вами», — Кармен Кочінеро, спеціаліст із порятунку заручників" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "Аквадруком нанесено сіро-брунатну текстуру із синьо-зеленими клітковими візерунками.\n\nЦе не волинка, але вона грає пісню перед кожним похороном" },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "Нанесено зображення сучасного камуфляжу з червоними акцентами.\n\nЩороку в Бута збираються найкращі зброярі-дизайнери та показують свої найновіші творіння" },
	["an_emerald"] = { name = "an_emerald", desc = "На хромовану основу нанесено текстуру напівпрозорою смарагдовою фарбою з ефектом анодування.\n\n«На кого перетворився великий Себастьян Енке? На буркотливу бабцю? Що ж трапилося…» — Учитель і Бунтівник, частина 2" },
	["so_keycolors"] = { name = "so_keycolors", desc = "Частини зброї пофарбовано аерозольною фарбою в суцільні блакитний і помаранчевий кольори.\n\nВеличний зрівнювач" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "Нанесено зображення з використанням аквадруку та трафарету, а також оздоблено термонаклейками.\n\n«Чейз Тернер був видатною людиною… Вам важко досягти такої слави» — Фенікс та Посвячений, частина 1" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "Вигравіювано зображення черепів, квітів і змій.\n\n«Ось чому Гакслі робить всю тяжку роботу, треба лишень її підштовхнути…» — Змій і Шукач Правди, частина 2" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "Розфарбовано блакитною та сірою фарбою, що підкреслює форму зброї.\n\nРазом ми завжди сильніші" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "Вручну нанесено зображення чудовиська в психоделічних кольорах.\n\n«Вони звуть вас Демоном, так? Хех, таке страшне ім’я для такого бідолахи…» — Еліот Кінґсмен, найманець" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "Аквадруком нанесено синій камуфляж." },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "Cтриманий чорно-білий дизайн із перламутровими відблисками, розфарбований вручну.\n\nБІЛИЙ_1; ЧОРНИЙ_1; ПЕРЛАМУТРОВИЙ_1; ТИХИЙ_1;" },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "Нанесено зображення зі стриманим чорно-білим дизайном та з перламутровими вставками.\n\nБІЛИЙ_1; ЧОРНИЙ_1; ПЕРЛАМУТРОВИЙ_1; ГЛУШНИК_1; ПІСТОЛЕТ_1;" },
	["m4a1s_black_lotus"] = { name = "m4a1s_black_lotus", desc = "На синю й фіолетову основу нанесено зображення чорної квітки лотоса.\n\nДодає два вбивства під час раунду гвинтівок, а потім скидається" },
	["ssg08_dezastre"] = { name = "ssg08_dezastre", desc = "Чорний, білий і червоний колір вручну нанесений на корпус у стилі хай-тек.\n\nЗавжди дотримуйтеся рекомендацій виробника щодо безпечного користування" },
	["ump45_neo_noir"] = { name = "ump45_neo_noir", desc = "На сіре тло нанесено стилізоване синьо-пурпурове зображення дівчини.\n\n«З ножем в руці й відповідальністю в душі»" },
}
